import './App.css';
import { useState } from 'react'


function App() {

  const [input, setInput] = useState('')

  //let command = ''
  const handleInput = (e) => {
    setInput(e.target.value)
  }

  return (
    <div class='App'>
      <History
       input={input}
      />
      <input onChange={handleInput}/>
      <button /*onClick={handleClick}*//>
    </div>
  )
}

function History(input) {

  return (
    <ul>
      <li>{input}</li>
    </ul>
  )
}



export default App;
